import home from './imagenes/home.png';
import './App.css';
import Button from 'react-bootstrap/Button';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



function App() {
  return (
    <Router>
    <div className="img">
   <img src= {home}/>
    <button className="boton" color= "primary">Contacto</button>
   <button id="buton" color="primary">Proyectos</button>


 </div>
 </Router>
  )
 }
export default App;
